import { ChevronLeft, ChevronRight, Plus, Edit2, Trash2 } from 'lucide-react';
import { useState } from 'react';
import { useParams } from 'react-router'; 
import { Flashcard } from '../components/FlashCard';
import { useModal } from '../../lib/shared/modal/modal';
import { VoiceRecorder } from '../components/VoiceRecorder';

export const DeckDetailPage = () => {
  const { deckId } = useParams<{ deckId: string }>();
  const { openModal, closeModal } = useModal();
  const [currentCard, setCurrentCard] = useState();
  const [currentVoice, setCurrentVoice] = useState<string>('');

  const [cards, setCards] = useState([
    { id: 1, front: 'Bonjour', back: 'Hello', voice: 'data:audio/wav;base64,'},
    { id: 2, front: 'Merci', back: 'Thank you', voice: 'data:audio/wav;base64,' },
    { id: 3, front: 'Chat', back: 'Cat', voice: 'aasdddddddddddddddddddddd'},
    { id: 4, front: 'Pain', back: 'Bread', voice: 'asdfaaaaaaaaaaaaaaaa' },
  ]);

  const [currentIndex, setCurrentIndex] = useState(0);
  const tempCurrentCard = cards[currentIndex] || { front: 'No cards', back: 'Add some!', voice: '' };

  const nextCard = () => setCurrentIndex((prev) => (prev + 1) % cards.length);
  const prevCard = () => setCurrentIndex((prev) => (prev - 1 + cards.length) % cards.length);

  const openAddCardModal = () => {
    openModal({
      title: "Add New Flashcard",
      content: (
        <div className="space-y-4">
          <p className="text-sm text-gray-500">Adding to Deck ID: {deckId}</p>
          <input className="w-full border p-2 rounded" placeholder="Front (e.g. French)" />
          <input className="w-full border p-2 rounded" placeholder="Back (e.g. English)" />
          <VoiceRecorder onAudioSerialized={(data)=>setCurrentVoice(data)} />
          <button className="w-full bg-blue-600 text-white py-2 rounded" onClick={closeModal}>
            Save Card
          </button>
        </div>
      )
    });
  };


  

  return (
    <div className="max-w-4xl mx-auto p-6 space-y-12">
      {/* 1. Header Area */}
      <header className="flex justify-between items-center">
        <div>
          <h1 className="text-2xl font-bold italic">Deck Detail</h1>
          <p className="text-sm text-gray-400 font-mono">ID: {deckId}</p>
        </div>
        <button 
          onClick={openAddCardModal} 
          className="bg-blue-600 hover:bg-blue-700 text-white px-4 py-2 rounded-xl flex items-center gap-2 transition-all shadow-md active:scale-95"
        >
          <Plus size={18} /> New Card
        </button>
      </header>
      {/* 2. Study Section */}
      <section className="flex flex-col items-center gap-6 py-8">
        {/* Added key={currentIndex} so the card resets flip state on navigation */}
        <Flashcard key={currentIndex} front={tempCurrentCard.front} back={tempCurrentCard.back} voice={tempCurrentCard.voice} />
        
        <div className="flex gap-6 items-center">
          <button onClick={prevCard} className="p-3 border rounded-full hover:bg-gray-100 transition-all shadow-sm active:scale-95">
            <ChevronLeft size={24} />
          </button>
          <span className="font-mono font-bold text-lg bg-gray-100 px-4 py-1 rounded-full text-blue-600">
            {cards.length > 0 ? currentIndex + 1 : 0} / {cards.length}
          </span>
          <button onClick={nextCard} className="p-3 border rounded-full hover:bg-gray-100 transition-all shadow-sm active:scale-95">
            <ChevronRight size={24} />
          </button>
        </div>
      </section>

      <hr className="border-gray-100" />

      {/* 3. Manage Section - Now a Grid of Square Cards */}
      <section>
        <h2 className="text-lg font-semibold mb-6 text-gray-700">Cards in this deck</h2>
        
        <div className="grid grid-cols-2 sm:grid-cols-3 md:grid-cols-4 gap-4">
          {cards.map((card) => (
            <div 
              key={card.id} 
              className="aspect-square relative group bg-white border-2 border-gray-100 rounded-2xl p-4 flex flex-col items-center justify-center text-center shadow-sm hover:border-blue-200 hover:shadow-md transition-all"
            >
              <span className="text-sm font-bold text-gray-800 break-words w-full px-2">
                {card.front}
              </span>

              {/* Action Overlay */}
              <div className="absolute top-2 right-2 flex gap-1 opacity-0 group-hover:opacity-100 transition-opacity">
                <button className="p-1.5 bg-white/80 backdrop-blur-sm text-gray-500 hover:text-blue-600 rounded-lg shadow-sm border border-gray-100">
                  <Edit2 size={14} />
                </button>
                <button className="p-1.5 bg-white/80 backdrop-blur-sm text-gray-500 hover:text-red-600 rounded-lg shadow-sm border border-gray-100">
                  <Trash2 size={14} />
                </button>
              </div>
            </div>
          ))}

          {/* Optional: "Add Quick" card placeholder */}
          <button 
            onClick={openAddCardModal}
            className="cursor-pointer aspect-square border-2 border-dashed border-gray-200 rounded-2xl flex flex-col items-center justify-center text-gray-400 hover:text-blue-500 hover:border-blue-200 hover:bg-blue-50/30 transition-all"
          >
            <Plus size={32} strokeWidth={1} />
            <span className="text-xs font-medium mt-2">New Card</span>
          </button>
        </div>

        {cards.length === 0 && (
          <div className="py-20 text-center border-2 border-dashed rounded-3xl text-gray-400">
            No cards yet. Start adding!
          </div>
        )}
      </section>
    </div>
  );
};